# ===========
# GAME LOGIC
# ===========
# These classes are for different game objects like the  
# player, bullets, aliens, and objects (meteoroids and asteroids)

class Bullet:
    """The bullets that are fired from the player, removed when off screen"""
    def __init__(self, pos, vel):
        # We copy the vector so changes to it don't affect the original
        self.pos = pos.copy() 
        self.vel = vel.copy()

        self.radius = 5
        self.speed = 10
        
    def update(self):
        self.pos.add(self.vel) # Moves the bullet
        
    def draw(self, canvas):
        canvas.draw_circle(self.pos.get_p(), self.radius, 1, "Yellow", "Yellow") 
        
    def off_screen(self):
        return (self.pos.x < 0 or self.pos.x > WIDTH or 
                self.pos.y < 0 or self.pos.y > HEIGHT)

class Player:
    """The player's spaceship, moves using WASD or arrow keys, shoots with spacebar"""
    def __init__(self, x, y):
        self.pos = Vector(x, y)  
        self.vel = Vector(0, 0)
        self.speed = 7
        self.radius = 20
        self.shoot_cooldown = 0 # Frames needed to pass until next shot
        self.lives = 3

        self.spaceship_sheet = {
            "url" : "https://clipart-library.com/new_gallery/856963_spaceship-sprite-png.png",
            "width" : 1600, "height" : 1600
        }

        self.img = simplegui.load_image(self.spaceship_sheet["url"])
        self.width = self.spaceship_sheet["width"]
        self.height = self.spaceship_sheet["height"]

        self.frame_centre_x = self.width / 2
        self.frame_centre_y = self.height / 2

    def draw(self, canvas):
        canvas.draw_image(self.img, (self.frame_centre_x, self.frame_centre_y), (self.width, self.height) , self.pos.get_p(), (60, 60))

    def update(self, game):
        # Set velocity to 0 at the start of each frame 
        # This stops movement when no keys are pressed
        self.vel = Vector(0, 0)
        self.speed = 7 # Resets speed when not shooting

        # Handles movement and shooting
        for key in keys_pressed:
            if key == simplegui.KEY_MAP["left"] or key == simplegui.KEY_MAP["a"]:
                self.vel.x -= self.speed
            if key == simplegui.KEY_MAP["right"] or key == simplegui.KEY_MAP["d"]:
                self.vel.x += self.speed
            if key == simplegui.KEY_MAP["up"] or key == simplegui.KEY_MAP["w"]:
                self.vel.y -= self.speed
            if key == simplegui.KEY_MAP["down"] or key == simplegui.KEY_MAP["s"]:
                self.vel.y += self.speed
            if key == simplegui.KEY_MAP["space"]:
                self.shoot(game)
                self.speed = 3 # Slow down player when shooting


        # Makes diagonal movement the same speed as horizontal/vertical movement
        # Also prevents double inputs (d + right) from doubling speed
        if self.vel.length() > 0:
            self.vel = self.vel.normalize() * self.speed

        self.pos.add(self.vel) 

        # Stops spaceship from going off screen
        # min will take the minimum of the two values
        # max will take the maximum of the two values 
        self.pos.x = max(0, min(self.pos.x, WIDTH))
        self.pos.y = max(0, min(self.pos.y, HEIGHT))

        # Every frame cooldown decreases
        if self.shoot_cooldown > 0:
            self.shoot_cooldown -= 1

    def shoot(self, game):
        if self.shoot_cooldown == 0:
            bullet_vel = Vector(0, -self.speed * 3)
            game.bullets.append(Bullet(self.pos, bullet_vel)) # track bullets fired in a list, useful for removal later
            self.shoot_cooldown = 5

class Alien:
    """The player shoots at aliens, they spawn randomly from the top of the screen and move towards the player"""
    def __init__(self, player):
        self.player = player 
        self.spawn()
        self.in_collision = False
        self.collision_cooldown = 0 # Frames needed to pass until Alien can damage player after colliding 
        self.speed = 6

    def spawn(self):
        random_spawn = random.randint(0, WIDTH) # Randomly spawns alien anywhere from top of screen
        self.pos = Vector(random_spawn, -50) # Allows the alien to come into view naturally 
        offset = Vector(random.uniform(-100, 100), random.uniform(-100, 100)) # Aliens don't have perfect aim, makes the game feel more fair and realistic 
        direction = (self.player.pos + offset - self.pos).normalize() # Aims towards the player, given as a unit Vector 
        self.vel = direction.multiply(5)

    def update(self):
        self.pos.add(self.vel)

        if self.screen_edge():
            self.turn_to_player()
            self.in_collision = False # Allows the alien to hurt the player again

    def draw(self, canvas):
        canvas.draw_image(ALIEN_IMG, ALIEN_CENTRE, ALIEN_DIMS, self.pos.get_p(), (80, 80))

    def bounce(self, player):
        if not self.in_collision:
            # Reflects the alien off the player using the normal vector (player -> alien)
            # self.pos - player.pos gives the vector facing out from the player, 
            # which is needed for reflection and direction for bounce
            normal = (self.pos - player.pos).get_normalized()
            direction = self.pos.copy().reflect(normal).normalize() 
            self.in_collision = True # Alien can only hurt the player once (until it bounces off the screen edge)
            self.vel = direction.multiply(self.speed * 1.5)

    def turn_to_player(self):
        offset = Vector(random.uniform(-100, 100), random.uniform(-100, 100)) 
        direction = (self.player.pos + offset - self.pos).normalize() 
        self.vel = direction.multiply(self.speed)

    def screen_edge(self):
        return (
            self.pos.x < 0 or self.pos.x > WIDTH or
            self.pos.y < 0 or self.pos.y > HEIGHT
        )

class Obstacles:
    """Spawns a animated meteoroid or static planet from the top of the screen"""

    # A class variable so that the planet next planet to spawn is always different 
    planet_index = 0 

    def __init__(self, frame_duration, speed):

        self.meteoroid_sheet = {
            "url": "https://imgur.com/bqRlQBK.png",
            "width": 510, "height": 500, "columns": 6, "rows": 5
        }

        self.planet_sheet = {
            "url": "data:image/png;base64,",
            "width": 512, "height": 512, "columns": 4, "rows": 4
        }

        self.spriteChoice = random.choice([self.meteoroid_sheet, self.planet_sheet]) # The obstacle will randomly be either a meteoroid or planet
        self.img = simplegui.load_image(self.spriteChoice["url"])
        self.width = self.spriteChoice["width"]
        self.height = self.spriteChoice["height"]
        self.columns = self.spriteChoice["columns"]
        self.rows = self.spriteChoice["rows"]
        self.frame_duration = frame_duration

        self.frame_width = self.width / self.columns
        self.frame_height = self.height / self.rows
        self.frame_centre_x = self.frame_width / 2
        self.frame_centre_y = self.frame_height / 2

        if self.spriteChoice is self.planet_sheet:
            # cycles through all planets, resets at the end 
            self.frame_index = [ 
                Obstacles.planet_index % self.columns, # column 
                Obstacles.planet_index // self.columns # row 
            ] 
            Obstacles.planet_index = (Obstacles.planet_index + 1) % (self.columns * self.rows)  
        else:
            self.frame_index = [0, 0] # Start at the beginning of sprite sheet for meteoroids

        # Spawns either obstacle anywhere from top of screen
        self.pos = Vector(random.randint(0, WIDTH), -50)
        self.vel = Vector(0, speed)
        self.radius = 30

        self.frame_clock = 0  # Used to track animation frame for meteoroids

    def update_index(self):
        if self.spriteChoice is self.meteoroid_sheet: # Only meteroids get animated
            self.frame_index[0] = (self.frame_index[0] + 1) % self.columns  # step through the columns hoirizontally 
            if self.frame_index[0] == 0:                                    
                self.frame_index[1] = (self.frame_index[1] + 1) % self.rows # step through the rows vertically 

    def draw(self, canvas):
        self.frame_clock += 1
        if self.frame_duration > 0 and self.frame_clock % self.frame_duration == 0:
            self.update_index()

        source_centre = (
            self.frame_width * self.frame_index[0] + self.frame_centre_x,
            self.frame_height * self.frame_index[1] + self.frame_centre_y
        )

        source_size = (self.frame_width, self.frame_height)
        dest_centre = (self.pos.x, self.pos.y)
        dest_size = (100, 100)

        canvas.draw_image(self.img, source_centre, source_size, dest_centre, dest_size)
        
    def update(self):
        self.pos.add(self.vel)

    def off_screen(self):
        return self.pos.y > HEIGHT  
   
    def hit(self, player):
        distance = player.pos.copy().subtract(self.pos).length()
        return distance < player.radius + self.radius

class Game_Manager:
    """Manages all game logic. Replaces the need for global variables"""

    def __init__(self):
        self.game_state = STATE_MENU
        self.score = 0 # Score goes up by 10 for alien killed 
        self.bullets = [] # Added to in Player.shoot()
        self.obstacles = []
        self.aliens = []
        player.pos = Vector(WIDTH / 2, HEIGHT / 2) # Resets player position
        player.lives = 3 # Player
        self.max_aliens = 1 # Changes amount of aliens on screen 
        self.cooldown = 180 # Decremented by 1 every frame in update
        self.warning_active = False
        self.warning_timer = 0 # For the flashing warning message
        self.frame_count = 0 # Tracks frames for spawning obstacles

    def click(self):
        # Starts a new game 
        self.__init__()
        self.game_state = STATE_PLAYING

    def click_back_menu(self):
        # Go to menu
        self.__init__()
        self.game_state = STATE_MENU

    def spawn_obstacle(self):
        # Spawn obstacles while playing 
        if self.game_state == STATE_PLAYING:
            random_speed = random.randint(1, 6)
            self.obstacles.append(Obstacles(10, random_speed)) # tracks obstacles in a list, for removal later

    def spawn_alien(self):
        # Spawn aliens while playing 
        if self.game_state == STATE_PLAYING:
            self.aliens.append(Alien(player))

    def update(self):
        player.update(self)
        
        if (self.frame_count % 120) == 0: # Spawn obstacle every two seconds (60 frames per second)
            self.spawn_obstacle()
            self.frame_count = 0

        # Remove off screen bullets
        active_bullets = []
        for bullet in self.bullets:
            bullet.update()
            if not bullet.off_screen():
                active_bullets.append(bullet)
        self.bullets = active_bullets

        # Remove off screen obstacles 
        self.obstacles = [obstacle for obstacle in self.obstacles if not obstacle.off_screen()]
        for obstacle in self.obstacles:
            obstacle.update() 

        for alien in self.aliens:
            alien.update()

        # If no aliens are on screen, show warning during cooldown then spawn more
        # Readies the player for the next alien wave 
        if len(self.aliens) == 0:
            self.warning_active = True
            if self.cooldown <= 0:
                for _ in range(self.max_aliens):
                    self.spawn_alien()
                self.cooldown = 300
                self.warning_active = False

        if self.game_state == STATE_PLAYING:
            self.check_collision()

        self.frame_count += 1 # increment frame count for obstacle spawning 
        self.cooldown -= 1 # decrement cooldown for alien spawning 

    def check_collision(self):
        bullets_to_remove = []
        aliens_to_remove = []
        obstacles_to_remove = []

        # Bullets and alien collisions
        # Bullets kill aliens and increase the score 
        for bullet in self.bullets:
            for alien in self.aliens:
                if bullet.pos.copy().subtract(alien.pos).length() < bullet.radius + 40:
                    bullets_to_remove.append(bullet)
                    aliens_to_remove.append(alien)
                    self.score += 10
                    if self.score % 30 == 0: # Increase max aliens every 30 points
                        self.max_aliens += 1
                    self.cooldown = 180 # Stops instant spawning of aliens after one dies

        # Player and alien collisions
        # Player loses a life on impact
        for alien in self.aliens:
            if player.pos.copy().subtract(alien.pos).length() < player.radius + 40 and not alien.in_collision:
                alien.bounce(player) 
                player.lives -= 1
                if player.lives <= 0:
                    self.game_state = STATE_GAME_OVER

        # Player and meteroid collisions
        for obstacle in self.obstacles:
            if obstacle.hit(player):
                obstacles_to_remove.append(obstacle)
                player.lives -= 1
                if player.lives <= 0:
                    self.game_state = STATE_GAME_OVER

        # Remove objects marked for removal 
        self.bullets = [b for b in self.bullets if b not in bullets_to_remove]
        self.aliens = [a for a in self.aliens if a not in aliens_to_remove]
        self.obstacles = [o for o in self.obstacles if o not in obstacles_to_remove]

