def draw_menu(canvas):
    canvas.draw_text("Alien Outbreak", [230, 100], 60, "Green")
    canvas.draw_text("As the last defender of humanity you must navigate through space", [20, 160], 25, "Red", "sans-serif") 
    canvas.draw_text("fighting to survive an invasion that never ends...", [140, 190], 25, "Red", "sans-serif")

    canvas.draw_text("Instructions:", [10, 270], 20, "Green", "sans-serif")
    canvas.draw_text("Dodge deadly meteoroids, rogue planets and shoot aliens before they get you!", [10, 300], 17, "Red", "sans-serif")
    canvas.draw_text("But this is not all, you only have 3 lives!", [10, 320], 17, "Red", "sans-serif")
    canvas.draw_text("So make sure you dodge the meteoroids, planets and kill the aliens otherwise you lose a life.", [10, 340], 17, "Red", "sans-serif")
    canvas.draw_text("Up Arrow or W = Move Up", [10, 380], 17, "Red", "sans-serif")
    canvas.draw_text("Down Arrow or S = Move Down", [10, 400], 17, "Red", "sans-serif")
    canvas.draw_text("Left Arrow or A= Move Left", [10, 420], 17, "Red", "sans-serif")
    canvas.draw_text("Right Arrow or D = Move Right", [10, 440], 17, "Red", "sans-serif")
    canvas.draw_text("Spacebar = Shoot", [10, 460], 17, "Red", "sans-serif")
    canvas.draw_text("Click START when ready!", [190, 540], 40, "Green", "sans-serif")

# Draws all game objects and background
def draw_game(canvas):
    game.update()

    # Background
    canvas.draw_image(BACKGROUND_IMG, BACKGROUND_CENTRE, 
                      (BACKGROUND_WIDTH, BACKGROUND_HEIGHT), 
                      (WIDTH / 2, HEIGHT / 2), (WIDTH, HEIGHT)) 

    player.draw(canvas)

    for bullet in game.bullets:
        bullet.draw(canvas)

    for alien in game.aliens:
        alien.draw(canvas)

    for meteoroid in game.obstacles:
        meteoroid.draw(canvas)

    for i in range(player.lives):
        heart_x = WIDTH - (i + 1) * 40  
        heart_y = 30  
        canvas.draw_image(HEART_IMG, HEART_CENTRE, HEART_DIMS, (heart_x, heart_y), HEART_SIZE)

    # Flash warning message
    if game.warning_active:
        game.warning_timer += 1
        if (game.warning_timer // 10) % 2 == 0:  
            canvas.draw_text("WARNING!!!", (WIDTH / 2 - 80, 50), 36, "Red")
        else:
            canvas.draw_text("WARNING!!!", (WIDTH / 2 - 80, 50), 36, "White")
    else:
        game.warning_timer = 0

    canvas.draw_text(f"Score: {game.score}", (20, 40), 30, "White")

# Called 60 times a second, picks the draw function depending on game state
def draw(canvas):
    if game.game_state == STATE_MENU:
        draw_menu(canvas)
    elif game.game_state == STATE_PLAYING:
        draw_game(canvas)
    elif game.game_state == STATE_GAME_OVER:
        draw_game_over(canvas)


def draw_game_over(canvas):
    canvas.draw_text("GAME OVER", [120, 200], 100, "Red")
    canvas.draw_text("Click 'Start' button if you want to play the game again.",[200,300], 20, "white")
    canvas.draw_text("Click 'Back to Menu' button to go to the Main Page.", [200, 350], 20, "white")
    canvas.draw_text(f"Score: {game.score}", [370, 450], 30, "White")

# =============
# KEY HANDLING
# =============
# Tracks keys pressed 
def keydown(key):
    if key in simplegui.KEY_MAP.values():
        keys_pressed.append(key)

def keyup(key):
    if key in simplegui.KEY_MAP.values():
        keys_pressed.remove(key)

