# SETUP
# ======

player = Player(WIDTH / 2, HEIGHT / 2) 
game = Game_Manager()
game.game_state = STATE_MENU

frame = simplegui.create_frame("Alien Outbreak", WIDTH, HEIGHT)
frame.add_button("START", game.click, 150)
frame.add_button("BACK TO MENU", game.click_back_menu, 150)
frame.set_draw_handler(draw)
frame.set_keydown_handler(keydown)
frame.set_keyup_handler(keyup)

keys_pressed = list() 

frame.start()
